import React, { Component } from 'react';
import TicketService from '../services/TicketService';

class CreateTicketComponent extends Component {

    constructor(props){
        super(props)
        this.state = {
            id: '',
            ticket: ''
        }

        this.changeIdHandler = this.changeIdHandler.bind(this);
    }

    changeIdHandler = (event) =>{
        this.setState({id: event.target.value})
    }

    saveTicket = (e) => {
        e.preventDefault();
        let ticket = {author: this.state.author,title: this.state.title,description: this.state.description, status: this.state.status};
        console.log('ticket => ' + JSON.stringify(ticket));

        TicketService.getTicketsByID(ticket).then(res => {
            this.props.history.push('/getTicketByID/')
        });
    }

    submitID = (e) => {
        e.preventDefault();
        TicketService.getTicketsByID(id).then((res) => {
            
            this.setState({res: ticket})
            console.log(res)
        });
        
    }
    
    render() {
        return (
            <div className= "container">
                <div className = "container">
                    <div className = "row">
                        <form>
                            <div className="form-group">
                             <div className = "form-group">
                                   <label> id</label>
                                   <input placeholder= "id" name="id" className="form-control" value={this.state.id} onChange={this.changeidHandler}/>
                                </div>
                             <button className="btn btn-success" onClick={this.submitID}>submit</button>
                             </div>
                         </form>
                    </div>
                </div>
                    <div className="row">
                        <h2 className="text-centre"> Tickets</h2>
                    </div>
            
                <div className = "row"> 
                    <table className ="table table-striped table-bordered" >
                        <thead> 
                            <tr>
                                <th>id </th>
                                <th>author </th>
                                <th>description </th>
                                <th>title </th>
                                <th>status </th>
                            </tr>
                        </thead>

                        <tbody>
                            {
                                this.state.ticket.map(
                                    ticket =>
                                        <tr key = {ticket.id}>
                                        <td>{ticket.id}</td>
                                        <td>{ticket.author}</td>
                                        <td>{ticket.description}</td>
                                        <td>{ticket.title}</td>
                                        <td>{ticket.status}</td>
                                    </tr>
                                )
                            }
                        </tbody>
                    </table>
                </div>
            </div>
        )
    }
            
}

export default CreateTicketComponent;
